    @Test
    public void requestHttps() throws IOException {
        String url = "https://tooth.goandfight.com/livehood/v1.0/";
        String params = "{" +
                "\"systemID\":\"A002\"," +
                "\"data\": {" +
                "\"serviceID\": \"ylz.ps.fj.si.i.queryInsu110\"," +
                "\"aac002\":\"350128196602130013\"," +
                "\"rows\":\"1\"," +
                "\"cpage\":\"1\"" +
                " }" +
                " }";

        RequestBuilder builder = RequestBuilder.post();
        // 构建消息实体
        HttpEntity httpEntity = new StringEntity(params, "UTF-8");
        if (httpEntity != null) {
            builder.setEntity(httpEntity);
            builder.setHeader("Content-type", "application/x-www-form-urlencoded");
            builder.setHeader("User-Agent", "Mozilla/4.0 (compatible; MSIE 5.0; Windows NT; DigExt)");
        }
        // 指定请求url
        HttpUriRequest request = builder.setUri(url).build();
        RequestConfig requestConfig = RequestConfig.custom().setSocketTimeout(3000).setConnectTimeout(3000).build();
        HttpClientBuilder httpClientBuilder;
        // 如果是http请求
        // Support SSL
        SSLConnectionSocketFactory sslConnectionSocketFactory = new SSLConnectionSocketFactory(createSSLContext());
        httpClientBuilder = HttpClients.custom().setDefaultRequestConfig(requestConfig)
                .setSSLSocketFactory(sslConnectionSocketFactory);

        CloseableHttpClient client = httpClientBuilder.build();

        CloseableHttpResponse response = client.execute(request);

        // 获得状态码
        int statusCode = response.getStatusLine().getStatusCode();

        // 获取请求结果
        HttpEntity entity = response.getEntity();
        String webPage = EntityUtils.toString(entity, "UTF-8");

        System.out.println("statusCode:" + statusCode + ", content:" + webPage);
    }

    /**
     * Default X509TrustManager implement
     */
    private static class HttpsTrustManager implements X509TrustManager {

        @Override
        public void checkClientTrusted(X509Certificate[] x509Certificates, String s) throws CertificateException {
            // ignore
        }

        @Override
        public void checkServerTrusted(X509Certificate[] x509Certificates, String s) throws CertificateException {
            // ignore
        }

        @Override
        public X509Certificate[] getAcceptedIssuers() {
            return null;
        }
    }

    private static HttpsTrustManager httpsTrustManager = new HttpsTrustManager();

    private SSLContext createSSLContext() {
        try {
            SSLContext sslContext = SSLContext.getInstance("TLS");
            sslContext.init(null, new HttpsTrustManager[]{httpsTrustManager}, null);
            return sslContext;
        } catch (Exception e) {
            throw new IllegalStateException("Create SSLContext error", e);
        }
    }

